// SVG UTILITIES PRIMARY COLOR
import ClockSVG from "./svg/room-detail/clock.svg";
import BedSVG from "./svg/room-detail/bed.svg";
import TelevisionSVG from "./svg/room-detail/television.svg";
import AirConditionSVG from "./svg/room-detail/air-conditioner.svg";
import KitchenSVG from "./svg/room-detail/kitchen.svg";
import ToiletSVG from "./svg/room-detail/toilet.svg";
import RefrigeratorSVG from "./svg/room-detail/refrigerator.svg";
import WifiSVG from "./svg/room-detail/wifi.svg";
import WashingMachineSVG from "./svg/room-detail/washing-machine.svg";
import ParkingSVG from "./svg/room-detail/motorcycle.svg";

// SVG UTILITIES DEFAULT COLOR

import ClockDefaultSVG from "./svg/room-detail/utilities-default/clock-default.svg";
import BedDefaultSVG from "./svg/room-detail/utilities-default/bed-default.svg";
import TelevisionDefaultSVG from "./svg/room-detail/utilities-default/television-default.svg";
import AirConditionDefaultSVG from "./svg/room-detail/utilities-default/air-conditioner-default.svg";
import KitchenDefaultSVG from "./svg/room-detail/utilities-default/kitchen-default.svg";
import ToiletDefaultSVG from "./svg/room-detail/utilities-default/toilet-default.svg";
import RefrigeratorDefaultSVG from "./svg/room-detail/utilities-default/refrigerator-default.svg";
import WifiDefaultSVG from "./svg/room-detail/utilities-default/wifi-default.svg";
import WashingMachineDefaultSVG from "./svg/room-detail/utilities-default/washing-machine-default.svg";
import ParkingDefaultSVG from "./svg/room-detail/utilities-default/motorcycle-default.svg";

export {
  // SVG UTILITIES PRIMARY COLOR
  ClockSVG,
  BedSVG,
  TelevisionSVG,
  AirConditionSVG,
  KitchenSVG,
  ToiletSVG,
  RefrigeratorSVG,
  WifiSVG,
  WashingMachineSVG,
  ParkingSVG,
  // SVG UTILITIES DEFAULT COLOR
  ClockDefaultSVG,
  BedDefaultSVG,
  TelevisionDefaultSVG,
  AirConditionDefaultSVG,
  KitchenDefaultSVG,
  ToiletDefaultSVG,
  RefrigeratorDefaultSVG,
  WifiDefaultSVG,
  WashingMachineDefaultSVG,
  ParkingDefaultSVG,
};
